I customer invoices into EDI messages and sends using the customers preferred method either ftp or email attachments."),("33","EmailCustTrans.php","Emails selected invoice or credit to the customer"),("34","FTP_RadioBeacon.php","FTPs sales orders for dispatch to a radio beacon software enabled warehouse dispatching facility"),("35","FreightCosts.php","Defines the setup of the freight cost using different shipping methods to different destinations. The system can use this information to calculate applicable freight if the items are defined with the correct kgs and cubic volume"),("36","GLAccountInquiry.php","Shows the general ledger transactions for a specified account over a specified range of periods"),("37","GLAccounts.php","Defines the general ledger accounts"),("38","GLBalanceSheet.php","Shows the balance sheet for the company as at a specified date"),("39","GLCodesInquiry.php","Shows the list of general ledger codes defined with account names and groupings"),("40","GLJournal.php","Entry of general ledger journals, periods are calculated based on the date entered here"),("41","GLProfit_Loss.php","Shows the profit and loss of the company for the range of periods entered"),("42","GLTransInquiry.php","Shows the general ledger journal created for the sub ledger transaction specified"),("43","GLTrialBalance.php","Shows the trial balance for the month and the for the period selected together with the budgeted trial balances"),("44","GoodsReceived.php","Entry of items received against purchase orders"),("45","GoodsReceivedControlled.php","Entry of the serial numbers or batch references for controlled items received against purchase orders"),("46","InventoryPlanning.php","Creates a pdf report showing the last 4 months use of items including as a component of assemblies together with stock quantity on hand, current demand for the item and current quantity on sales order."),("47","InventoryValuation.php","Creates a pdf report showing the value of stock at standard cost for a range of product categories selected"),("48","Locations.php","Defines the inventory stocking locations or warehouses"),("49","Logout.php","Shows when the user logs out of webERP"),("50","MailInventoryValuation.php","Meant to be run as a scheduled process to email the stock valuation off to a specified person. Creates the same stock valuation report as InventoryValuation.php"),("51","MailSalesReport.php","Creates a sales analysis pdf report and emails it to the defined receipients. This script is meant to be run as a scheduled process for daily or weekly sales reporting"),("52","MailSalesReport_csv.php","Creates a sales analysis report as a comma separated values (csv) file and emails it to the defined receipients. This script is meant to be run as a scheduled process for daily or weekly sales reporting"),("53","OrderDetails.php","Shows the detail of a sales order"),("54","OutstandingGRNs.php","Creates a pdf showing all GRNs for which there has been no purchase invoice matched off against."),("55","PDFBankingSummary.php","Creates a pdf showing the amounts entered as receipts on a specified date together with references for the purposes of banking"),("56","PDFChequeListing.php","Creates a pdf showing all payments that have been made from a specified bank account over a specified period. This can be emailed to an email account defined in config.php - ie a financial controller"),("57","PDFDeliveryDifferences.php","Creates a pdf report listing the delivery differences from what the customer requested as recorded in the order entry. The report calculates a percentage of order fill based on the number of orders filled in full on time"),("58","PDFLowGP.php","Creates a pdf report showing the low gross profit sales made in the selected date range. The percentage of gp deemed acceptable can also be entered"),("59","PDFPriceList.php","Creates a pdf of the price list applicable to a given sales type and customer. Also allows the listing of prices specific to a customer"),("6