 a selected item and selected customer/branch. The currency and sales type is defaulted from the customer\'s record"),("74","PrintCustOrder.php","Creates a pdf of the dispatch note - by default this is expected to be on two part pre-printed stationery to allow pickers to note discrepancies for the confirmer to update the dispatch at the time of invoicing"),("75","PrintCustOrder_generic.php","Creates two copies of a laser printed dispatch note - both copies need to be written on by the pickers with any discrepancies to advise customer of any shortfall and on the office copy to ensure the correct quantites are invoiced"),("76","PrintCustStatements.php","Creates a pdf for the customer statements in the selected range"),("77","PrintCustTrans.php","Creates either a html invoice or credit note or a pdf. A range of invoices or credit notes can be selected also."),("78","PurchData.php","Entry of supplier purchasing data, the suppliers part reference and the suppliers currency cost of the item"),("79","ReverseGRN.php","Reverses the entry of goods received - creating stock movements back out and necessary general ledger journals to effect the reversal"),("80","SalesAnalReptCols.php","Entry of the definition of a sales analysis report\'s columns."),("81","SalesAnalRepts.php","Entry of the definition of a sales analysis report headers"),("82","SalesAnalysis_UserDefined.php","Creates a pdf of a selected user defined sales analysis report"),("83","SalesGLPostings.php","Defines the general ledger accounts used to post sales to based on product categories and sales areas"),("84","SalesPeople.php","Defines the sales people of the business"),("85","SalesTypes.php","Defines the sales types - prices are held against sales types they can be considered price lists. Sales analysis records are held by sales type too."),("86","SelectCompletedOrder.php","Allows the selection of completed sales orders for inquiries - choices to select by item code or customer"),("87","SelectCreditItems.php","Entry of credit notes from scratch, selecting the items in either quick entry mode or searching for them manually"),("88","SelectCustomer.php","Selection of customer - from where all customer related maintenance, transactions and inquiries start"),("89","SelectGLAccount.php","Selection of general ledger account from where all general ledger account maintenance, or inquiries are initiated"),("90","SelectOrderItems.php","Entry of sales order items with both quick entry and part search functions"),("91","SelectProduct.php","Selection of items. All item maintenance, transactions and inquiries start with this script"),("92","SelectSalesOrder.php","Selects a sales order irrespective of completed or not for inquiries"),("93","SelectSupplier.php","Selects a supplier. A supplier is required to be selected before any AP transactions and before any maintenance or inquiry of the supplier"),("94","ShipmentCosting.php","Shows the costing of a shipment with all the items invoice values and any shipment costs apportioned. Updating the shipment has an option to update standard costs of all items on the shipment and create any general ledger variance journals"),("95","Shipments.php","Entry of shipments from outstanding purchase orders for a selected supplier - changes in the delivery date will cascade into the different purchase orders on the shipment"),("96","Shippers.php","Defines the shipping methods available. Each customer branch has a default shipping method associated with it which must match a record from this table"),("97","Shipt_Select.php","Selection of a shipment for displaying and modification or updating"),("98","ShiptsList.php","Shows a list of all the open shipments for a selected supplier. Linked from POItems.php"),("99","SpecialOrder.php","Allows for a sales order to be created and an indent order to be created on a supplier for a one off item that may never be purchased again. A dummy part is created based on the description and cost details given."),("100","StockAdjustments.php","Entry of quantity corrections to stocks in a selected location."),("101","StockAdjustmentsControlled.php","Entry of batch references or serial numbers on controlled stock items being adjusted"),("102","StockCategories.php","Defines the stock categories. All items must refer to one of these categories. The category record also allows the specification of the general ledger codes where stock items are to be posted - the balance sheet account and the profit and loss effect of any adjustments and the profit and loss effect of any price variances"),("103","StockCheck.php","Allows creation of a stock check file - copying the current quantites in stock for later comparison to the entered counts. Also produces a pdf for the count sheets."),("104","StockCostUpdate.php","Allows update of the standard cost of items producing general ledger journals if the company preferences stock GL interface is active"),("105","StockCounts.php","Allows entry of stock counts"),("106","StockLocMovements.php","Inquiry shows the Movements of all stock items for a specified location"),("107","StockLocQties_csv.php","Makes a comma separated values (CSV)file of the stock item codes and quantities"),("108","StockLocStatus.php","Shows the stock on hand together with outstanding sales orders and outstanding purchase orders by stock location for all items in the selected stock category"),("109","StockLocTransfer.php","Entry of a bulk stock location transfer for many parts from one location to another."),("110","StockLocTransferReceive.php","Effects the transfer and creates the stock movements for a bulk stock location transfer initiated from StockLocTransfer.php"),("111","StockMovements.php","Shows a list of all the stock movements for a selected item and stock location including the price at which they were sold in local currency and the price at which they were purchased for in local currency"),("112","StockQties_csv.php","Makes a comma separated values (CSV)file of the stock item codes and quantities"),("113","StockReorderLevel.php","Entry and review of the re-order level of items by stocking location"),("114","StockSerialItems.php","Shows a list of the serial numbers or the batch references and quantities of controlled items. This inquiry is linked from the stock status inquiry"),("115","StockStatus.php","Shows the stock on hand together with outstanding sales orders and outstanding purchase orders by stock location for a selected part. Has a link to show the serial numbers in stock at the location selected if the item is controlled"),("116","StockTransferControlled.php","Entry of serial numbers/batch references for controlled items being received on a stock transfer. The script is used by both bulk transfers and point to point transfers"),("117","StockTransfers.php","Entry of point to point stock location transfers of a single part"),("118","StockUsage.php","Inquiry showing the quantity of stock used by period calculated from the sum of the stock movements over that period - by item and stock location. Also available over all locations"),("119","Stocks.php","Defines an item - maintenance and addition of new parts"),("120","SuppCreditGRNs.php","Entry of a supplier credit notes (debit notes) against existing GRN which have already been matched in full or in part"),("121","SuppInvGRNs.php","Entry of supplier invoices against goods received"),("122","SuppPaymentRun.php","Automatic creation of payment records based on calculated amounts due from AP invoices entered"),("123","SuppShiptChgs.php","Entry of supplier invoices against shipments as charges against a shipment"),("124","SuppTransGLAnalysis.php","Entry of supplier invoices against general ledger codes"),("125","SupplierAllocations.php","Entry of allocations of supplier payments and credit notes to invoices"),("126","SupplierContacts.php","Entry of supplier contacts and contact details including email addresses"),("127","SupplierCredit.php","Entry of supplier credit notes (debit notes)"),("