cyDebtorsBalances.php","Inquiry that shows the total foreign currency together with the total local currency (functional currency) balances of all customer accounts to reconcile with the general ledger debtors account"),("147","Z_CurrencySuppliersBalances.php","Inquiry that shows the total foreign currency amounts and also the local currency (functional currency) balances of all supplier accounts to reconcile with the general ledger creditors account"),("148","Z_DeleteCreditNote.php","Utility to reverse a customer credit note - a desperate measure that should not be used except in extreme circumstances"),("149","Z_DeleteInvoice.php","Utility to reverse a customer invoice - a desperate measure that should not be used except in extreme circumstances"),("150","Z_DeleteSalesTransActions.php","Utility to delete all sales transactions, sales analysis the lot! Extreme care required!!!"),("151","Z_MakeStockLocns.php","Utility to make LocStock records for all items and locations if not already set up."),("152","Z_PriceChanges.php","Utility to make bulk pricing alterations to selected sales type price lists or selected customer prices only"),("153","Z_ReApplyCostToSA.php","Utility to allow the sales analysis table to be updated with the latest cost information - the sales analysis takes the cost at the time the sale was made to reconcile with the enteries made in the gl."),("154","Z_RePostGLFromPeriod.php","Utility to repost all general ledger transaction commencing from a specified period. This can take some time in busy environments. Normally GL transactions are posted automatically each time a trial balance or profit and loss account is run"),("155","Z_ReverseSuppPaymentRun.php","Utility to reverse an entire Supplier payment run"),("156","Z_UpdateChartDetailsBFwd.php","Utility to recalculate the ChartDetails table B/Fwd balances - extreme care!!"),("157","Z_UploadForm.php","Utility to upload a file to a remote server"),("158","Z_UploadResult.php","Utility to upload a file 